package hackerrank;

import java.util.HashMap;
import java.util.Iterator;

// https://www.hackerrank.com/challenges/sherlock-and-valid-string/problem
// First try, actually.
// I did it but I'm sure there has to be a way to make this code
// less convoluted (without sorting)!!

public class SherlockAndTheValidString2 {

	static String isValid(String s) {
		if ( s == null || s.length ()<=2 ) return "YES";
		HashMap <Character, Integer> countMap = new HashMap <Character, Integer> ();
		for ( char c : s.toCharArray ()){
			countMap.put (c, countMap.getOrDefault(c,0) + 1);
		}

		//Get over the obvious cases.
		if ( countMap.keySet().size() == 1) return "YES";
		if ( countMap.keySet().size() == 2){
			Iterator < Character> iter = countMap.keySet().iterator();
			int a = countMap.get(iter.next());
			int b = countMap.get(iter.next());
			if ( Math.min (a,b) == 1) return "YES";
			return ( Math.abs ( a - b ) <= 1 )?"YES":"NO";
		}

		//Other cases.
		Iterator < Character> iter = countMap.keySet().iterator();
		int a = countMap.get(iter.next());
		int b = countMap.get(iter.next());
		int constant = 0;
		boolean overSeen = false;

		if ( a == b ){
			constant = a;
		}

		else {
			overSeen = true;

			if ( Math.min (a,b) == 1){
				//We need to look at the third element.
				int c = countMap.get(iter.next());
				if ( c == 1 ){
					// The constant is 1, but we need to check if the large element is 2.
					constant = 1;
					if (Math.max (a,b) != 2) return "NO";
				}
				else {
					constant = Math.max (a,b);
				}
			}
			else if ( Math.abs ( a - b ) >= 1 ) return "NO";
			else {
				constant = Math.min (a,b);
			}
		}

		while (iter.hasNext()){
			int n = countMap.get ( iter.next());

			if ( n != constant ){
				if ( n == 1 || n - constant == 1 ){
					if ( overSeen ) return "NO";
					else overSeen = true;
				}
				else if ( n < constant ) return "NO";
				else if ( n - constant >= 2 ) return "NO";
			}
		}        
		return "YES";
	}

	public static void main(String[] args) {



		String s = "";

		String qq = SherlockAndTheValidString2.isValid(s);

		System.out.println (qq);

	}

}
